import React from "react";
import {
  BrowserRouter as Router,
  Route,
  Routes,
  useLocation,
} from "react-router-dom";
import { AuthProvider } from "./services/AuthContext";
import Login from "./components/Login";
import Register from "./components/Register";
import Navbar from "./components/Tutor/Navbar";
import NavTutor from "./components/Tutor/NavTutor";
import Home from "./components/Student/Home";
import About from "./components/Student/About";
import Class from "./components/Student/Class";
import Profile from "./components/Student/Profile";
import Detail from "./components/Student/Detail";
import HomeTutor from "./components/Tutor/HomeTutor";
import AboutTutor from "./components/Tutor/AboutTutor";
import ClassTutor from "./components/Tutor/ClassTutor";
import DetailTutor from "./components/Tutor/DetailTutor";
import ProfileTutor from "./components/Tutor/ProfileTutor";
import CreateClass from "./components/Tutor/CreateClass";
import Dashboard from "./components/Admin/Dashboard";
import PrivateRoute from "./components/PrivateRoute";

const App = () => {
  return (
    <Router>
      <Main />
    </Router>
  );
};

const Main = () => {
  const location = useLocation();
  const userType = localStorage.getItem("user_type");

  // Tentukan apakah rute saat ini adalah login atau register
  const isAuthRoute =
    location.pathname === "/" || location.pathname === "/register";

  return (
    <AuthProvider>
      <div>
        {/* Tampilkan Navbar yang sesuai berdasarkan user type */}
        {!isAuthRoute && (userType === "tutor" ? <NavTutor /> : <Navbar />)}
        <Routes>
          <Route path="/register" element={<Register />} />
          <Route path="/" element={<Login />} />
          <Route
            path="/home"
            element={
              <PrivateRoute>
                <Home />
              </PrivateRoute>
            }
          />
          <Route
            path="/about"
            element={
              <PrivateRoute>
                <About />
              </PrivateRoute>
            }
          />
          <Route
            path="/class"
            element={
              <PrivateRoute>
                <Class />
              </PrivateRoute>
            }
          />
          <Route
            path="/profile"
            element={
              <PrivateRoute>
                <Profile />
              </PrivateRoute>
            }
          />
          <Route
            path="/class/:classId"
            element={
              <PrivateRoute>
                <Detail />
              </PrivateRoute>
            }
          />
          <Route
            path="/homeTutor"
            element={
              <PrivateRoute>
                <HomeTutor />
              </PrivateRoute>
            }
          />
          <Route
            path="/aboutTutor"
            element={
              <PrivateRoute>
                <AboutTutor />
              </PrivateRoute>
            }
          />
          <Route
            path="/classTutor"
            element={
              <PrivateRoute>
                <ClassTutor />
              </PrivateRoute>
            }
          />
          <Route
            path="/classTutor/:classId"
            element={
              <PrivateRoute>
                <DetailTutor />
              </PrivateRoute>
            }
          />
          <Route
            path="/profileTutor"
            element={
              <PrivateRoute>
                <ProfileTutor />
              </PrivateRoute>
            }
          />
          <Route
            path="/createClass"
            element={
              <PrivateRoute>
                <CreateClass />
              </PrivateRoute>
            }
          />
          <Route
            path="/dashboard"
            element={
              <PrivateRoute>
                <Dashboard />
              </PrivateRoute>
            }
          />
        </Routes>
      </div>
    </AuthProvider>
  );
};

export default App;
